import React from 'react';
import './labelTextarea.scss';

function LabelTextarea({classNameAdded = '', autoComplete = '', placeHolder =''}) {
    return (
        <>
            <label className={`${classNameAdded} labelTextarea`}>
                <textarea className="labelTextarea__input" autoComplete={autoComplete} placeholder={placeHolder} />
                <span className="labelTextarea__placeholder">{placeHolder}</span>
            </label>
        </>
    );
}

export default LabelTextarea;
